import { initAuth0 } from '@auth0/nextjs-auth0'

export default initAuth0({
    clientId: "iPFeZTS2rg0zoFpREXHwn6aSl0JPxpAS",
    clientSecret: "U49zI0Hg_Y1DrDbDH6R5X2_6rVhh0p9DO7aY2Vrhf3zrnct-YrSs1rDM-SwIE0t1",
    scope: "user",
    domain: "devplenoapp.auth0.com",
    redirectUri: "http://localhost:3000/api/callback",
    postLogoutRedirectUri: "http://localhost:3000/",
    session: {
        cookieSecret: 'abcabcasdfabcabcasdfabcabcasdfsd',
        cookieLifetime: 3600
    }
})
